import { NgModule } from '@angular/core';

import { ApprovalRoutingModule } from './route/approval-routing.module';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { ApprovePayrollNewComponent } from './approve-payroll-new/approve-payroll-new.component';
import { ApprovePayrollAmendComponent } from './approve-payroll-amend/approve-payroll-amend.component';

import { InputTextModule } from 'primeng/inputtext';
import { DividerModule } from 'primeng/divider';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { CardModule } from 'primeng/card';
import { FileUploadModule } from 'primeng/fileupload';
import { HttpClientModule } from '@angular/common/http';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { MessagesModule } from 'primeng/messages';
import { MessageModule } from 'primeng/message';
import { CheckboxModule } from 'primeng/checkbox';
import { PanelModule } from 'primeng/panel';
import { OverlayPanelModule } from 'primeng/overlaypanel';
import { VirtualScrollerModule } from 'primeng/virtualscroller';
import { ScrollPanelModule } from 'primeng/scrollpanel';
import { TableModule } from 'primeng/table';
import { ChipModule } from 'primeng/chip';
import { CalendarModule } from 'primeng/calendar';
import { MultiSelectModule } from 'primeng/multiselect';
import { DropdownModule } from 'primeng/dropdown';
import { DialogService } from 'primeng/dynamicdialog';
import { AccordionModule } from 'primeng/accordion';
import { DataEntryService } from 'app/workload/payroll-verifier/data-entry/service/data-entry.service';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DateUtilsService } from 'app/core/util/date-utils.service';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { TabViewModule } from 'primeng/tabview';

import { IcCodeService } from 'app/ng-connect';
import { ExportUtilsService } from 'app/core/util/export-utils.service';

@NgModule({
    imports: [
        CommonModule,
        SharedModule,
        ApprovalRoutingModule,
        InputTextModule,
        DividerModule,
        CardModule,
        FileUploadModule,
        HttpClientModule,
        InputTextareaModule,
        MessagesModule,
        MessageModule,
        PanelModule,
        FormsModule,
        ReactiveFormsModule,
        CheckboxModule,
        OverlayPanelModule,
        VirtualScrollerModule,
        ScrollPanelModule,
        TableModule,
        ChipModule,
        CalendarModule,
        MultiSelectModule,
        DropdownModule,
        AccordionModule
    ],
    declarations: [
        ApprovePayrollNewComponent,
        ApprovePayrollAmendComponent
    ],
    providers: [
        DataEntryService,
        ConfirmationService,
        DateUtilsService,
        NspConfirmationService,
        MessageService,
        DialogService,
        IcCodeService,
        ExportUtilsService
    ]
})
export class ApprovalModule {
}
